from typing import List


class Solution:
    def canJump(self, nums: List[int]) -> bool:
        length = len(nums)
        # define dp[i] = nums[i] can be reached
        dp = [False for i in range(length)]
        dp[0] = True
        for i in range(length):

            for j in range(i+1, i + 1 + nums[i]):
                if dp[j]:
                    continue
                if nums[i] + i >= j:
                    dp[j] = True

            # for j in range(i-1,-1):
            #     if dp[j] and nums[j] + j >= i:
            #         dp[i] = True
            #         break
        # print(dp)
        return dp[-1]


